const Profile = () => {

 return(
    <AppLayout>
        <div >
        <h1>MY Profile</h1>
        <div><Button href="/newLook">오늘의 데일리룩 만들기</Button></div>
        <section style={{marginTop: '50px'}}>
        <div style={{float: 'left'}}>
            <Card>
            <Calendar style={{width: '600px', height: '750px', float: 'left', border: 'solid'}}  mode='month' />

            </Card>
        </div>
           <MyInfo /> 
         <Mention />
         <LikeList/>
         <Followers />
        <Followings />   
        
        </section>
        <section>
            
        
        </section>
        </div>
    </AppLayout>
 );
};

export default Profile;
